import React from "react";
import { Firstname, Lastname,Village } from "./App";

const CompB = () => {
  return (
    <>
      <Firstname.Consumer>
        {fname => {
          return (
            <Lastname.Consumer>
              {lname => {
                return (
                  <h1>
                    {fname}
                    {lname}
                  </h1>
                );
              }}
            </Lastname.Consumer>
          );
        }}
      </Firstname.Consumer>
    </>
  );
};
export default CompB;
